import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click the bookmark button on the first post
    await page.waitForSelector('.post:first-child .bookmark-btn');
    await page.click('.post:first-child .bookmark-btn');

    // Wait for the bookmark icon to become filled
    await page.waitForSelector('.post:first-child .bookmark-btn i.filled', { timeout: 5000 });

    // Take a screenshot after clicking the bookmark
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_click.png'));

    return {
      success: true,
      action: "Clicked bookmark button on first post and verified icon became filled",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first post's bookmark button to be visible
    await page.waitForSelector('.post:first-child .bookmark-btn');

    // Click the bookmark button on the first post
    await page.click('.post:first-child .bookmark-btn');

    // Wait for a short moment to allow the bookmark action to complete
    await page.waitForTimeout(1000);

    // Verify that the bookmark icon becomes filled (assuming it changes class to 'filled')
    const isBookmarked = await page.$eval('.post:first-child .bookmark-btn i', el => el.classList.contains('filled'));

    // Take a screenshot after the action
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_click.png'));

    // Return the success status and extracted data
    return {
      success: isBookmarked,
      action: isBookmarked ? "Bookmark icon is filled" : "Bookmark icon is not filled",
      extractedData: { isBookmarked },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

